import React from 'react';
import './checkout.styles.scss';


const CheckOutPage = () => {
    return (
        <div className='checkout-page'>
            <div className='checkout-header'>
                <div className='header-'></div>
            </div>
        </div>
    );
};


export default CheckOutPage;
